import './Array.css';

function Array(pros) {
  return (
    <div className="Array">
      <hr></hr>
      <div class="registro">
        <h3>Mr. {pros.texto.sobrenome}</h3>
        <p>
          Nome: {pros.texto.nome}
          Idade: {pros.texto.idade}
        </p>
      </div>
    </div>
  );
}

export default Array;
